import { arrayIncludes } from "./includesFunction";

test('Test 1: ("abcdefg", "cd") -> True', () => {
    const text = "abcdefg";
    const searchedText = "cd";
    expect(arrayIncludes(text, searchedText)).toBe(text.includes(searchedText));
})

test('Test 2: ("abcdefg", "gf") -> False', () => {
    const text = "abcdefg";
    const searchedText = "gf";
    expect(arrayIncludes(text, searchedText)).toBe(text.includes(searchedText));
})

test('Test 3: ("abcdefg", "abcdefg") -> True', () => {
    const text = "abcdefg";
    const searchedText = "abcdefg";
    expect(arrayIncludes(text, searchedText)).toBe(text.includes(searchedText));
})

